

class Solution(object):
    def maxProduct(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        if not nums:
            return 0
        lp = nums[:]
        lp_min = nums[:]
        for i in reversed(range(len(nums)-1)):
            t = (lp[i+1]*nums[i], lp_min[i+1]*nums[i])
            lp[i], lp_min[i] = max(t + (nums[i], )), min(t + (nums[i], ))
        return max(lp + lp_min)

